import React from 'react';
import pokemons from '../data'

class Pokemon extends React.Component {
  render() {
    return pokemons.map((pokemon)=> {<div>
    <h1>{pokemon.name}</h1>
    <h1>{pokemon.type}</h1>
    <h1>{pokemon.averageWeight}</h1>
    </div>
  });
  }
}
export default Pokemon;
